import React from "react";
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import { Query } from 'react-apollo';
import  { gql } from 'apollo-boost';

import HomePage from './pages/homepage/homepage';
import TrailDetail from './pages/traildetail/traildetail';
import Authorization from './pages/authorization/authorization';
import Profile from './pages/profile/profile';
import TestPage from './pages/testpage/testpage';

const App = (props) => (
   <Query query={IS_LOGGED_IN_QUERY}>
      {(data, loading, error) => {
         if (loading) return <div></div>
         if (error) return <div>Error</div>
         console.log(data)
         return (
            <BrowserRouter>
               <Switch>
                  <Route exact path='/' component={HomePage} />
                  {/* <Route exact path='/traildetail/:id' component={TrailDetail} isLoggedIn={data.isLoggedIn} /> */}
                  <Route exact path='/traildetail/:id' render={(props) => <TrailDetail {...props} />} />
                  <Route exact path='/auth' component={Authorization} />
                  <Route exact path='/profile' component={Profile} />
                  <Route exact path='/test' component={TestPage} />
               </Switch>
            </BrowserRouter>
         )
      }}
   </Query>

);



const CONVO_THREADS_QUERY = gql`
   {
      conversationThreads(hikerID:1) {
      hikerID {
         user {
            username
         }
      }
      recipientID {
         user {
            username
         }
      }
      timeSent 
      content
      }
   }
`


export default App;
